import React, { useState, useEffect } from "react";
import CardsList from "./test";
import Cards from "./cards";
/* import Create from "./test";
 */ const App = () => {
  const [movies, setMovie] = useState([]);
  const api =
    "https://api.themoviedb.org/3/search/movie?api_key=fac34116c639f3e75cd5205251be421c&query=search";

  useEffect(() => {
    fetch(api)
      .then((res) => res.json())
      .then((res) => setMovie(res.results));
  }, []);

  return (
    <div>
      {movies.map((movie) => (
        <Cards
          key={movie.id}
          title={movie.title}
          overview={movie.overview}
          img={movie.poster_path}
        />
      ))}
      {console.log(movies)}
    </div>
  );
};

export default App;
